package Bit_Manipulation;

/*
Problem Statement
Given a positive integer that fits in a 32-bit signed integer, find if it can be expressed as A^P where P > 1 and A > 0.

A and P both should be integers.

Example 1:
Input:

2

Output:

false

Explanation:

2 cannot be written as ap for any a and p integers.

Example 2:
Input:

148877

Output:

true

Explanation:

148877 = 236 therefore it can be written as ap where a = 23 and p = 6
 */
public class Power_of_Two_Integers {
    public static void main(String[] args) {
        System.out.println(isPower(148877));
    }

    public static boolean isPower(int x) {
        if (x == 1) return true;


        for (int i = 2; i * i <= x; i++) {
            int power = 2;
            while (Math.pow(i, power) <= x) {
                if (Math.pow(i, power) == x) {
                    System.out.println("A = "+i+", P = "+power);
                    return true;
                }
                power++;
            }
        }

        return false;
    }
}
